COTS Journal, the journal of military electronics and computing, is a technology-in-context book that looks at any embedded technology any-where it exists. COTS Journal enjoys a broad readership of engineers and senior engineering management specializing in the development of embedded computers for government, military and aerospace applications. The editors and staff of COTS Journal are dedicated to providing the industry with the best quality technical material to help readers design and build embedded computers for the military - whether for benign applications or for the most rugged, mission-critical jobs the battlefield, sky or water can offer.
